import React from 'react'
import { user } from '../data';


function UserCard({img, name, username, followers, following}) {
  return (
    <div>
      <img src="img" alt="userAvatar" />
      <br/>
      <h2>{user.name}</h2>
      <h3>{user.login}</h3>
      <p>logo followers: <span>{user.followers}</span> . following: <span>{user.following}</span></p>
    </div>
  )
}

export default UserCard
